	function getMaker(item) {
		var maker = 'maker';
		if (item.tlic == '2') {
			if (item.tipo == "G") {
				maker = "fun_g";
			} else if (item.tipo == "H") {
				maker = "fun_h";
			} else if (item.tipo == "I") {
				maker = "fun_i";
			} else if (item.tipo == "J") {
				maker = "fun_j";
			} else if (item.tipo == "M") {
				maker = "fun_m";
			} else if (item.tipo == "O") {
				maker = "fun_o";
			}
		} else {
			maker = 'edif';
		}
		return maker;

	}

	function licenciasTipoFilter(valor) {

		if (valor == "1") {
			return "Contrucción nueva";
		} else if (valor == "2") {
			return "Construccion ampliación";
		} else if (valor == "3") {
			return "Contruccion remodelación";
		} else if (valor == "4") {
			return "Contruccion regulizacion";
		} else if (valor == "5") {
			return "Demolición total";
		} else if (valor == "6") {
			return "Demolición parcial";
		} else if (valor == "7") {
			return "obras menores";
		} else {
			return "Otros";
		}
	}

	function getMakerHtml(item) {
		/*
				<table class="table">
				<tr> <td>propietario</td> </tr>
				<tr> <td>nomempresa</td> </tr>
				<tr> <td>direccion</td> </tr>
				<tr> <td> <a href="" class="btn"  > mas detalle</a> </td> </tr>
			</table>
        	*/
		var html = '<table class="table">';
		//ubicacion
		if (item.tlic == '2') { // funcionamiento
			html += '<thead><tr> <th class="text-center">Licencia de funcionamiento</th> </tr></thead>';
			html += '<tr> <td>' + item.nom_empresa + '</td> </tr>';
			html += '<tr> <td>' + item.giro + '</td> </tr>';
			html += '<tr> <td>' + item.ubicacion + '</td> </tr>';

		} else { // edificacion
			html += '<thead><tr> <th class="text-center">Licencia de Edificacion</th> </tr></thead>';
			html += '<tr> <td>' + item.propietario + '</td> </tr>';
			html += '<tr> <td>' + item.ubicacion + '</td> </tr>';
			html += '<tr> <td>' + licenciasTipoFilter(item.tipo) + '</td> </tr>';
		}
		html += '<tr> <td><a href="#sis/licencias/' + item.tlic + '/' + item.id + '" class="btn"  > más detalle</a></td> </tr>';
		html += '</table>';
		return html;

	}

