	this.getItemById = function(ida, idb) {
		var defered = $q.defer();
		$timeout(function() {
			for (var i = 0; i < data.length; i++) {
				if (data[i].tlic == ida && data[i].id == idb) {
					defered.resolve(data[i]);
				}
			};
			defered.reject(false);
		}, 0);

		return defered.promise;
	}

