	this.getDataMap = function() {

		var datafiltrada = [
			['Lat', 'Long', 'Name', 'Marker'],
		];

		var lat, lng;
		for (var i = 0; i < data.length; i++) {
			lat = parseFloat(data[i].lat);
			lng = parseFloat(data[i].long);
			datafiltrada.push([lat, lng, getMakerHtml(data[i]), getMaker(data[i])]);
		};

		return $q.when(datafiltrada);

	}

